import React from 'react';

class Why extends React.Component {
    constructor (props) {
        super(props);

        };

        render() {
            return (
                <div id="whyContainer">
                    <div id="whyImg">
                        
                    </div>

                    <div id="whyContent">
                        <strong><u>Who are we?</u></strong><br />
                        This here is why we do what we do. We will most likely have one or two sentences explaining our values and integrity.
                    </div>


                    <style jsx>
                        {`
                        
                        #whyContainer {
                            height: 100%;
                            width: 200px;
                        }

                        #whyImg {
                            height: 150px;
                            width: 150px;
                            background-color: red;
                            margin: auto;
                            border-radius: 50%;
                        }

                        #whyContent {
                            color: white;
                            
                        }

                        `}
                    </style>
                </div>
            )
        }
    }

export default Why;
